import "./style/HomePage.css"

import React from 'react';
import Typewriter from "typewriter-effect";

const HomePage = () => {

    const onHover = (e) => {
        e.currentTarget.src = require("./../images/profile/drawn_profile.jpg")
    }

    const onRemove = (e) => {
        e.currentTarget.src = require("./../images/profile/profile.jpg")
    }

    return (
        <>
            <div id="page-container">
                <div id="profile-container">
                    <img src={require("./../images/profile/profile.jpg")}
                        onMouseOver={(e) => onHover(e)}
                        onMouseOut={(e) => onRemove(e)} />
                </div>

                <div id="about-container">
                    <Typewriter
                        options={{
                            strings: ["Welcome! I'm Angela"],
                            autoStart: true,
                            loop: true
                        }}
                    />
                </div>
            </div>
        </>
    )
}

export default HomePage;
